&lt;p&gt;Folii protectoare pentru vizorul exterior la costumul de vopsitor.&lt;/p&gt;

&lt;p&gt;Utilizare: Se monteaza 1-5 folii pe vizorul exterior.&amp;nbsp;Se indeparteaza cate 1 folie cand aceasta s-a deteriorat.&lt;/p&gt;

&lt;p&gt;Ambalare: pachet 25 folii&lt;/p&gt;

&lt;p&gt;Material: Sort piele box bovina; Diverse culori; Dimensiune 105x65 cm.&lt;/p&gt;

&lt;p&gt;Inchidere la spate prin catarama metalica si cordon din piele cusute si nituite.&lt;br /&gt;
Grosime: de la 1,6 mm la 1,8 mm.&lt;br /&gt;
Acest articol poate fi confectionat din mai multe bucati de piele.&lt;br /&gt;
Imagina este cu titlu de prezentare si nu poate crea obligatii contractuale.&lt;/p&gt;
